(function ($) {
        'use strict';

        var eagc = {
            init: function () {
                this.stickyHeader();
                this.masonry();
                this.navigationMenu();
                this.slider();

            },
            masonry: function () {

                $('.grid').masonry({
                    // options
                    itemSelector: '.grid-item',
                    columnWidth: 200
                });
            },
            navigationMenu:function(){
                $('.hamburger').on('click', function () {
                    $(this).find('.hamburger--line').toggleClass('hamburger--line__x');
                    $(this).next('.nav-right').find('#navigation').slideToggle();
                });
            },
            stickyHeader:function(){
                $(document).scroll(function (e) {
                    var scrollTop = $(document).scrollTop();
            
                    if (scrollTop > 120) {
                        //console.log(scrollTop);
                        $('.main-header').addClass('sticky');
            
                    } else {
                        $('.main-header').removeClass('sticky');
            
                    }
                });
            },
            slider:function(){
                $("#owl-one").owlCarousel({
                    margin: 0,
                    nav: !1,
                    items: 1,
                    dots: !0,
                    loop: !0,
                    autoplay: !0,
                    smartSpeed: 1e3,
                    autoplayTimeout: 1e4,
                    touchDrag: !1,
                    mouseDrag: !1,
                    animateOut: "fadeOut"
                })
            }










        }

        eagc.init();
    }
    (jQuery));







